// Function to get products by category
export const getProductsByCategory = (category) => {
    if (!category) return allProducts;
    return allProducts.filter(product => product.category === category);
};

// Function to get product by ID
export const getProductById = (id) => {
    return allProducts.find(product => product.id === parseInt(id));
};

// Function to get recommendations by category (excluding current product)
export const getRecommendationsByCategory = (category, excludeProductId = null, limit = 4) => {
    const filteredProducts = allProducts.filter(product => {
        if (product.category !== category) return false;
        if (excludeProductId && product.id === parseInt(excludeProductId)) return false;
        return true;
    });
    
    return filteredProducts.slice(0, limit);
};

// Function to get alternative products (same composition)
export const getAlternativeProducts = (productId) => {
    const currentProduct = getProductById(productId);
    if (!currentProduct || !currentProduct.sameAs) return [];
    
    return currentProduct.sameAs
        .map(id => getProductById(id))
        .filter(product => product && product.id !== parseInt(productId));
};

// Function to get all unique categories
export const getAllCategories = () => {
    const categories = [...new Set(allProducts.map(product => product.category))];
    return categories;
};

// Function to get products by multiple categories
export const getProductsByMultipleCategories = (categories) => {
    if (!categories || categories.length === 0) return allProducts;
    return allProducts.filter(product => categories.includes(product.category));
};

// Function to get category-wise product counts
export const getCategoryCounts = () => {
    const counts = {};
    allProducts.forEach(product => {
        counts[product.category] = (counts[product.category] || 0) + 1;
    });
    return counts;
};

// Function to get featured products (products with highest discount)
export const getFeaturedProducts = (limit = 6) => {
    return allProducts
        .sort((a, b) => (b.discount || 0) - (a.discount || 0))
        .slice(0, limit);
};